import React from "react"
import './SearchBar.css'
import GroupButton from "./GroupButton"

export default function SearchBar(){
    return(
        <div>
            <input className="searchbar" type='text' placeholder="enter a country"/>
            <GroupButton />
        </div>
    )
}
